def f(n):
    s, out = list(map(int, str(n))), 0
    for i in range(len(s)-1):
        dir = 1 if s[i+1] - s[i] >= 0 else -1
        for j in range(s[i]+dir, s[i+1], dir):
            out = 10*out + j
    return out
def ok(n):
    return (v:=f(n)) and v%n == 0
